"use strict";(self.webpackChunkjohnycho_dev=self.webpackChunkjohnycho_dev||[]).push([[7508],{9679:d=>{d.exports=JSON.parse('{"tag":{"label":"Database","permalink":"/docs/tags/db","description":"Database tag description","allTagsPath":"/docs/tags","count":5,"items":[{"id":"db/db-redis-single-thread","title":"Redis\uac00 \uc2f1\uae00 \uc2a4\ub808\ub4dc\ub85c \ub9cc\ub4e4\uc5b4\uc9c4 \uc774\uc720","description":"Redis\uac00 \ub2e8\uc77c \uc2a4\ub808\ub4dc(single-threaded)\ub85c \uc124\uacc4\ub41c \uc774\uc720\ub294 \uc8fc\ub85c \uc131\ub2a5 \ucd5c\uc801\ud654, \ubcf5\uc7a1\uc131 \uac10\uc18c, \uadf8\ub9ac\uace0 \ub370\uc774\ud130 \uc77c\uad00\uc131\uc744 \uc720\uc9c0\uc5d0 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/db/db-redis-single-thread"},{"id":"db/db-lock","title":"\uacf5\uc720 \ub77d\uacfc \ubc30\ud0c0 \ub77d","description":"DBMS\uc5d0\uc11c \ud2b8\ub79c\uc7ad\uc158\uc744 \ud2b9\ubcc4\ud55c \uc81c\uc5b4 \uc5c6\uc774 \ubcd1\ud589 \uc218\ud589\uc744 \ud5c8\uc6a9\ud55c\ub2e4\uba74 \ub370\uc774\ud130\uc758 \uc77c\uad00\uc131\uacfc \ubb34\uacb0\uc131\uc744 \ubcf4\uc7a5\ud558\uae30 \uc5b4\ub824\uc6b8 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774\ub54c, \ubcd1\ud589 \uc218\ud589\ub418\ub294 \ud2b8\ub79c\uc7ad\uc158\ub4e4\uc744 \uc81c\uc5b4\ud558\uae30 \uc704\ud574\uc11c \ub77d\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc73c\uba70 DBMS\uc5d0\uc11c \ub77d\uc740 \ud06c\uac8c \uacf5\uc720 \ub77d\uacfc \ubc30\ud0c0 \ub77d\uc73c\ub85c \ubd84\ub958\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","permalink":"/docs/db/db-lock"},{"id":"db/db-index","title":"\ub370\uc774\ud130\ubca0\uc774\uc2a4 \uc778\ub371\uc2a4","description":"\ub370\uc774\ud130\ubca0\uc774\uc2a4 \ud14c\uc774\ube14\uc758 \uac80\uc0c9 \uc18d\ub3c4\ub97c \ud5a5\uc0c1\uc2dc\ud0a4\uae30 \uc704\ud55c \uc790\ub8cc\uad6c\uc870\ub85c \ubc31\uacfc\uc0ac\uc804\uc758 \uc0c9\uc778\uacfc \uac19\uc2b5\ub2c8\ub2e4. \uc800\uc7a5\ub418\ub294 \uceec\ub7fc\uc758 \uac12\uc744 \uc0ac\uc6a9\ud558\uc5ec \ud56d\uc0c1 \uc815\ub82c\ub41c \uc0c1\ud0dc\ub97c \uc720\uc9c0\ud558\ub294 \uac83\uc774 \ud2b9\uc9d5\uc785\ub2c8\ub2e4. \uc774\ub7ec\ud55c \ud2b9\uc9d5\uc73c\ub85c \uc778\ud574 \uc778\ub371\uc2a4\ub294 INSERT, UPDATE, DELETE\uc758 \uc131\ub2a5\uc774 \ud76c\uc0dd\ub41c\ub2e4\ub294 \uac83\uc774 \ub2e8\uc810\uc785\ub2c8\ub2e4.","permalink":"/docs/db/db-index"},{"id":"db/db-connection-pool","title":"\ub370\uc774\ud130\ubca0\uc774\uc2a4 \ucee4\ub125\uc158 \ud480","description":"\uc560\ud50c\ub9ac\ucf00\uc774\uc158\uacfc \ub370\uc774\ud130\ubca0\uc774\uc2a4\uac00 \ud1b5\uc2e0\uc744 \ud558\uae30 \uc704\ud574\uc11c\ub294 \ub370\uc774\ud130\ubca0\uc774\uc2a4 \ucee4\ub125\uc158\uc774 \ud544\uc694\ud569\ub2c8\ub2e4.","permalink":"/docs/db/db-connection-pool"},{"id":"db/db-transaction-isolation-level","title":"\ud2b8\ub79c\uc7ad\uc158 \uaca9\ub9ac\uc218\uc900","description":"\ub3d9\uc2dc\uc5d0 \uc5ec\ub7ec \ud2b8\ub79c\uc7ad\uc158\uc774 \uc2e4\ud589\ub420 \ub54c \ud55c \ud2b8\ub79c\uc7ad\uc158\uc774 \ub2e4\ub978 \ud2b8\ub79c\uc7ad\uc158\uc758 \uc5f0\uc0b0\uc5d0 \uc601\ud5a5\uc744 \ubc1b\uc9c0 \uc54a\ub3c4\ub85d \ud558\ub294 \uc815\ub3c4\ub97c \ub9d0\ud569\ub2c8\ub2e4. \ub0ae\uc740 \uaca9\ub9ac \uc218\uc900\uc740 \ub3d9\uc2dc \ucc98\ub9ac \ub2a5\ub825\uc744 \ub192\uc774\uc9c0\ub9cc, \ub370\uc774\ud130\uc758 \uc77c\uad00\uc131 \ubb38\uc81c\ub97c \ubc1c\uc0dd\uc2dc\ud0ac \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ubc18\uba74, \ub192\uc740 \uaca9\ub9ac \uc218\uc900\uc740 \ub370\uc774\ud130\uc758 \uc77c\uad00\uc131\uc744 \ubcf4\uc7a5\ud558\uc9c0\ub9cc, \ub3d9\uc2dc \ucc98\ub9ac \ub2a5\ub825\uc774 \ub5a8\uc5b4\uc9c8 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc989, \ub370\uc774\ud130 \uc815\ud569\uc131\uacfc \uc131\ub2a5\uc740 \ubc18\ube44\ub840\ud569\ub2c8\ub2e4. \ud2b8\ub79c\uc7ad\uc158 \uaca9\ub9ac \uc218\uc900\uc740 \uac1c\ubc1c\uc790\uac00 \ud2b8\ub79c\uc7ad\uc158 \uaca9\ub9ac \uc218\uc900\uc744 \uc124\uc815\ud560 \uc218 \uc788\ub294 \uae30\ub2a5\uc744 \uc81c\uacf5\ud558\ub294 \uae30\ub2a5\uc785\ub2c8\ub2e4.","permalink":"/docs/db/db-transaction-isolation-level"}],"unlisted":false}}')}}]);